import React from "react";

import curlyBraces from "../../images/curlyBraces.png";
import logopersonal from "../../images/logopersonal.png";
import plus from "../../images/plus.png";

const PersonalLogo = () => {
  return (
    <div className="PersonalLogo row justify-content-center">
      <div className="col-12 mt-3 mt-4">
        <div className="row justify-content-center m-sm-4">
          <div className="logo col-4">
            <img
              className="img-fluid"
              alt="Logo de trabajo social"
              src={logopersonal}
            />
          </div>
          <div className="logo col-4">
            <img
              className="img-fluid"
              alt="Logo de trabajo social"
              src={plus}
            />
          </div>
          <div className="logo col-4">
            <img
              className="img-fluid"
              alt="Logo de trabajo social"
              src={curlyBraces}
            />
          </div>
        </div>
      </div>
      <h2 className="h.5 logo col-12">Sobre mi Logo</h2>
      <p className="col-12 text-justify">
        Mi logo se compone de dos elementos.....Por una parte el logo de trabajo
        social representado por la rueda dentada, la mano y la hoja de olivo y
        por la otra, y cómo nexo de unión, dos elementos de codigo. En concreto
        <code>curly braces</code>, dando lugar a una única <code>function</code>
        .
      </p>
    </div>
  );
};

export default PersonalLogo;
